import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import Logo from '../logo.svg'

export default class Navbar extends Component {
    render() {
        return (
            <nav className="navbar navbar-light bg-light">
                <Link to='/'>
                    {/* <p className="navbar-brand">Riddle Store</p> */}
                    <img src={Logo} alt="Logo" width="50px" className="navbar-brand"/>
                </Link>
                <ul className="navbar-nav align-items-center">
                    <li className="nav-item ml-5"><Link to='/'>Products</Link></li>
                </ul>
                <Link to='/cart' className="ml-auto"><button><i className="fa fa-cart-plus"></i></button></Link>
            </nav>
        )
    }
}
